import { useEffect, useState } from "react"
import { Container, Row } from "react-bootstrap"
import Api, { endpoints } from "../configs/Api"

const EmployerList = ()=>{
    const [employer, setemployer]=useState([])

    useEffect(() =>{
        let loadEmloyer = async() =>  {
            try{
                let res = await Api.get(endpoints['employer'])
                setemployer(res.data.results)
            } catch(err){   
                console.error(err)
            } 
        }
        
        loadEmloyer()
    },[])


    return(
        <Container>
            <h1 class="text-center text-danger">Danh sách các nha ung vien </h1>
            
            <Row>
                {employer.map(c => {
                    return <ECard image={c.image} title={c.title} address={c.address} created_date={c.created_date} id={c.id}/>
                })}
            </Row>
       </Container>
    )

}
export default EmployerList
